var count = 0, tempcount = 0
async function metamasklock() {
	if (typeof web3 !== "undefined") {
		web3 = new Web3(web3.currentProvider);
		const accounts = await ethereum.request({

			method: 'eth_accounts'

		})
			.then()
			.catch((accounts) => {
				if (error.code === 4001) {

				} else {

				}
			});
		if (accounts.length == 0 && count == 0) {
			msg = 'Your metamask account is locked please unlock';
			type = 'error';
			count = count + 1
			validate_msg(type, msg)
			await enableAccount()
		}
		else {
			count = 0
			accounts1 = accounts;
			var address = accounts1[0];
			User = address
			if (address == admin_address) {
				var values = { 'address': address }
				$.ajax({
					url: '/account_address/',
					csrfmiddlewaretoken: "{{ csrf_token }}",
					headers: {
						'Accept': 'application/json',
						'Content-Type': 'application/json'
					},
					type: 'post',
					data: JSON.stringify(values),
					success: function (data) {
						msg = ('Metamask login successfully');
						type = 'success';
						validate_msg(type, msg)
						localStorage.setItem('network_selected', 'metamask');
						setTimeout(location.reload.bind(location), 5000);
					},
					error: function (data) {
						alert('create not successfully');
					}
				});
			} else {
				msg = 'Connect Admin wallet';
				type = 'error';
				validate_msg(type, msg)

			}

		}
	}
	else {
		msg = 'Your metamask addon not installed in browser.';
		type = 'error';
		validate_msg(type, msg)
	}

};


async function enableAccount() {

	const accounts = await ethereum.enable();
	accounts1 = accounts;
	$('.click_metamaskcls').click()

}





