//covert covert_number(bal/Math.pow(10, 18))
function covert_number(x) {
	if (Math.abs(x) < 1.0) {
		var e = parseInt(x.toString().split('e-')[1]);
		if (e) {
			x *= Math.pow(10, e - 1);
			x = '0.' + (new Array(e)).join('0') + x.toString().substring(2);
		}
	} else {
		var e = parseInt(x.toString().split('+')[1]);
		if (e > 20) {
			e -= 20;
			x /= Math.pow(10, e);
			x += (new Array(e + 1)).join('0');
		}
	}
	return x.toString();
}

//convert wai
function convert_wei(x, to_format) {
	
	const weiFormats = {
		'0': 'noether',
		'1': 'wei',
		'3': 'kwei',
		'6': 'mwei',
		'9': 'gwei',
		'12': 'szabo',
		'15': 'milli',
		'18': 'ether',
		'21': 'kether',
		'24': 'mether',
		'27': 'gether',
		'30': 'tether'
	}
	web3 = new Web3(web3.currentProvider);
	if (web3 !== undefined) {
		let formatChange = weiFormats[`${to_format}`]
		let balance = web3.utils.toWei(`${x}`, formatChange);
		return balance
	}
	return 0.5
}



